import React from 'react';
import {
  MDBCard,
  MDBCardBody,
  MDBCardTitle,
  MDBCardText,
  MDBCardImage,
  MDBBtn,
  MDBRipple
} from 'mdb-react-ui-kit';
import { BASE_URL } from '../../constants/constants';

export default function List({bookingData}) {
    const [year, month, day] = bookingData.date.split('');

  return (
    <MDBCard>
      <MDBRipple rippleColor='light' rippleTag='div' className='bg-image hover-overlay'>
        <MDBCardImage src={`${BASE_URL}/courts/${bookingData.courtData.courtPic}`} fluid alt='...' />
        <a>
          <div className='mask' style={{ backgroundColor: 'rgba(251, 251, 251, 0.15)' }}></div>
        </a>
      </MDBRipple>
      <MDBCardBody>
        <MDBCardTitle>{bookingData.courtData.courtName}</MDBCardTitle>
        <MDBCardText>
            {bookingData.slot.name}
        </MDBCardText>
        <MDBCardText>
        Date: {day}/{month}/{year}     
           </MDBCardText> 
           <MDBCardText>
            {bookingData.courtData.location}
        </MDBCardText> <MDBCardText>
        {bookingData.courtData.address}
        </MDBCardText>
        <MDBBtn href='#'>Button</MDBBtn>
      </MDBCardBody>
    </MDBCard>
  );
}
